import React from "react";
import { Link } from "react-router-dom";

function Menu() {
  return (
    <nav>
      <Link to="/">Home</Link>
      <Link to="beans">Beans</Link>
      <Link to="combinations">Combinations</Link>
      <Link to="facts">Facts</Link>
      <Link to="history">History</Link>
    </nav>
  );
}

export default Menu;
